import React, { useRef, useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { useForm } from "react-hook-form";
import classes from "../views/Login.module.css";
import logo from "../assets/logo.png";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faUser, faLock } from "@fortawesome/free-solid-svg-icons";
import axios from "axios";

const Login = () => {
  // When the form is being submitted.
  const [busy, setBusy] = useState(false);
  const [emailErr, setEmailErr] = useState(null);
  const [passwordErr, setPasswordErr] = useState(null);

  const userRef = useRef();
  const navigate = useNavigate();

  const userIcon = <FontAwesomeIcon size="lg" icon={faUser} />;
  const lockIcon = <FontAwesomeIcon size="lg" icon={faLock} />;

  useEffect(() => {
    const getObj = localStorage.getItem("user_token");
    // Check for valid token against api
    getObj && navigate("/home");
  }, [navigate]);

  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm();

  const onSubmit = (data) => {
    setBusy(true);
    console.log(data);
    axios({
      method: "post",
      url: "http://dev.rapptrlabs.com/Tests/scripts/user-login.php",
      data: {
        email: data.email,
        password: data.password,
      },
      headers: { "Content-Type": "application/x-www-form-urlencoded" },
    })
      .then(function (response) {
        console.log(response.data);
        setBusy(false);
        localStorage.setItem("user_token", response.data.user_token);
        navigate("/home");
      })
      .catch(function (error) {
        console.log(error);
        setBusy(false);
      });
  };

  return (
    <div className={classes.body}>
      <div className={classes.container}>
        <div className={classes.mainBox}>
          <div className={classes.signinBox}>
            <h1>sign in</h1>
            <div className={classes.formContainer}>
              <form
                onSubmit={handleSubmit(onSubmit)}
                onChange={(e) => {
                  if (e.target.id === "email") {
                  } else if (e.target.id === "password") {
                    if (e.target.value.length < 5) {
                    } else {
                    }
                  }
                }}
              >
                <label htmlFor="email">Email</label>
                <div className={classes.inputForm}>
                  <span className={classes.inputIcon}>{userIcon}</span>
                  <input
                    type="email"
                    placeholder="user@rapptrlabs.com"
                    id="email"
                    ref={userRef}
                    autoComplete="off"
                    className={errors.email && "invalid"}
                    {...register("email", {
                      required: "Value is required and can't be empty",
                      maxLength: {
                        value: 50,
                        message: "Not a valid email",
                      },
                    })}
                  />
                </div>
                {(errors.email || emailErr) && (
                  <p className={classes.errMsg}>
                    {emailErr} {errors.email.message}
                  </p>
                )}

                <label htmlFor="password">Password</label>
                <div className={classes.inputForm}>
                  <span className={classes.inputIcon}>{lockIcon}</span>
                  <input
                    type="password"
                    placeholder="Must be at least 4 characters"
                    id="password"
                    ref={userRef}
                    autoComplete="off"
                    className={errors.password && "invalid"}
                    {...register("password", {
                      required: "Value is required and can't be empty",
                      minLength: {
                        value: 4,
                        message: "Password must be 4-16 characters long",
                      },
                      maxLength: {
                        value: 16,
                        message: "Password must be 4-16 characters long",
                      },
                    })}
                  />
                </div>
                {(errors.password || passwordErr) && (
                  <p className={classes.errMsg}>
                    {passwordErr} {errors.password.message}
                  </p>
                )}
                <button
                  className={
                    errors.email ||
                    errors.password ||
                    (busy ? "invalid-button" : "")
                  }
                  disabled={busy ? true : false}
                >
                  Login
                </button>
              </form>
            </div>
          </div>

          <div className={classes.leftbox}>
            <h2 className={classes.title}>
              <span className={classes.firstSpan}>Rapptr</span>
              <span> </span>
              <span className={classes.secondSpan}>Labs</span>
            </h2>
            <p className={classes.leftboxText}>From Idea to Adoption.</p>
            <img className={classes.logo} src={logo} alt="logo" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
